import React from 'react';
import { Link } from 'react-router-dom';
import './Sidebar.css';

const Sidebar = () => {
  return (
    <div className="sidebar">
      <h2>사이드바</h2>
      <ul>
        <li><Link to="/">홈</Link></li>
        <li><Link to="/login">로그인</Link></li>
        <li><Link to="/signup">회원가입</Link></li>
      </ul>
    </div>
  );
};

export default Sidebar;
